from typing import List

def mean_absolute_deviation(numbers: List[float]) -> float:
    if not numbers:
        raise ValueError("The list of numbers cannot be empty.")

    # Step 1: Calculate the mean of the numbers
    mean_value = sum(numbers) / len(numbers)

    # Step 2 & 3: Compute the sum of absolute deviations
    abs_diff_sum = sum(abs(num - mean_value) for num in numbers)

    # Step 4: Return the average of absolute deviations
    return abs_diff_sum / len(numbers)
